CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerTarjeta`(in idTarjeta integer)
BEGIN
SELECT tp.id_tarjeta, tp.placa, tp.ntarjeta,tp.razon1, tp.idclase,tp.idmarca, tp.fabricacion,
       tp.idmodelo, tp.version, tp.idcombustible, tp.idcarroceria, tp.ejes, tp.colores,
       tp.nmotor, tp.cilindros, tp.nserie, IFNULL(tp.vin,'0'), tp.ruedas, tp.pasajeros,
       tp.asientos, tp.peso_seco, tp.peso_bruto, tp.longitud, tp.altura, tp.ancho,
       tp.carga_util, tp.nruedas, tp.kilometraje, tp.tipoServicio
FROM tarjetapropiedad tp where tp.estado='2' and tp.id_tarjeta=idTarjeta;

END $$
